import React from "react"
import styled from "styled-components"


const Users = props => {

  const Userlist = styled.ul`
    list-style: none;
  `
  return (
    <Userlist>
      {props.users.map(user => (
        user.name
      ))}
    </Userlist>
  )
}

export default Users
